import React from "react";
import css from "@emotion/css";
import { COLORS } from "../../constants";
const ContactInfo = ({ isProfileData }) => {
  console.log("isProfileData", isProfileData);
  const cData = isProfileData && isProfileData.profile;
  return (
    <React.Fragment>
      <div className="p-4">
        {cData &&
          cData.length > 0 &&
          cData.map((contactDets) => (
            <div
              className="w-5/12"
              css={css`
                & > p {
                  border-bottom: 1px solid ${COLORS.GRAY};
                  display: block;
                }
              `}
            >
              <p className="clearfix">
                email: <span className="float-right">{contactDets.email}</span>
              </p>
              <p>
                Mobile Number: <span>{contactDets.mobileNumber}</span>
              </p>
            </div>
          ))}
      </div>
    </React.Fragment>
  );
};

export default ContactInfo;
